lab_slot_date_slot_by_date.map:
function (doc) {
          if (doc.type === "slots_date_slots" ) {
            var year = Number(doc.date.split("-")[2]);
            var month = Number(doc.date.split("-")[1]);
            var day = Number(doc.date.split("-")[0]);
            emit([doc.lab_id, year, month, day], { doc: doc });
          }
        }

