patient_without_avatar.map:
function (doc) {
  if(doc.type === "patients" && (!doc.avatar && doc.avatar !== null && doc.avatar !== "")){
    var year = Number(doc.created_at.split("-")[0]);
    var month = Number(doc.created_at.split("-")[1]);
    var day_time = doc.created_at.split("-")[2];
    var day = Number(day_time.split("T")[0])
    emit([doc.type, year, month, day], {doc:doc});
  }
}
